class FABSUser:
    def __init__(self):
        self.submissions = []

    def submit_fabs(self, data):
        # Validate data
        if not self.validate_fabs_data(data):
            return "Error: Invalid data"

        # Derive fields
        derived_data = self.derive_fabs_fields(data)

        # Save submission
        self.submissions.append(derived_data)
        return "Submission successful"

    def validate_fabs_data(self, data):
        # Check for required fields
        required_fields = ["agency_name", "funding_agency_code"]
        for field in required_fields:
            if field not in data:
                return False

        # Check for valid field values
        if data["funding_agency_code"] not in ["00*****", "00FORGN"]:
            return False

        return True

    def derive_fabs_fields(self, data):
        # Derive office name from office code
        office_code = data.get("office_code")
        office_name = self.get_office_name(office_code)

        # Derive other fields...
        derived_data = {
            "office_name": office_name,
            # Add other derived fields here
        }

        return {**data, **derived_data}

    def get_office_name(self, office_code):
        # Implement logic to get office name from office code
        office_names = {
            "123": "Office 123",
            "456": "Office 456"
        }
        return office_names.get(office_code, "Unknown office")


